interface Reminders {
  id: number;
  title: string;
}

interface ReminderListProps {
  items: Reminders[];
}

const Reminders = ({ items }, ReminderListProps) => {
  return (
    <ul>
      {items.map((item) => (
        <li key={item}>{item.title}</li>
      ))}
    </ul>
  );
};

export default Reminders;
